import React from 'react';
import Routes from './Routes/Routes'
import Header from './Components/header'
import Footer from './Components/footer'

class App extends React.Component{
  render(){
    return(
      <div>
        <Header/>
        <Routes/>
        <Footer/>
      </div>
    );
  }
}

export default App;
